package net.minecraft.src;import java.util.List;import modchu.lib.Modchu_Debug;import modchu.model.ModchuModel_CustomModel;import modchu.model.multimodel.MultiModelCustom;public class MultiModel_Custom1 extends MultiModelCustom {	public MultiModel_Custom1()	{		this(0.0F);	}	public MultiModel_Custom1(float f)	{		this(f, 0.0F);	}	public MultiModel_Custom1(float f, float f1)	{		this(f, f1 , 64, 32);	}	public MultiModel_Custom1(float f, float f1, int i, int j) {		super(f, f1, i, j);		String s = getClass().getSimpleName();		Modchu_Debug.Debug(""+s+" init");		s = s.substring(s.lastIndexOf("_Custom") + 7);		customModel = new ModchuModel_CustomModel(this, s, (List)null, f, f1);	}	@Override	public String getUsingTexture() {		return customModel.getUsingTexture();	}}